// JavaScript Document
import React from 'react';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";


//Smart Component
class StateActivities extends React.Component {
	//declaring state and new object
	state ={
		activityListing:[],
	}

//calling fetchData function
	componentDidMount(){
		this.fetchActivities();
}

//fetching API
fetchActivities(){
 fetch('https://developer.nps.gov/api/v1/activities?statecode=FL&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}
			 ).then(data =>{
		let mList = data.data.map((use)=>{
			return(
				<Grid container>
				<Grid item xs={12}>
				<h2>Park Activities</h2>
				</Grid>  
	  					<Grid item xs={12}>
							<li style={styles.activities}>{use.name}</li>
	  					</Grid>  	
				</Grid>  
			)
		})
		this.setState({StateActivities:mList});
	})
}
	 render() { 
  return (
	  <div> 	
	  {this.state.StateActivities}		
	  </div>
  );
 }
}
export default StateActivities

const styles ={
	activities:{
		columns: '3 auto',
		listStyleType:'none',
	},
}
